          "spotlight": "Ready win at Ayr (7f, good to firm) in May and creditable third over 6f here on her last two outings; likely to be in the shake-up again.",
          "medical": [],
          "quotes": [
            {
              "date": "2022-05-20",
              "horse": "Inanna",
              "horse_id": "4281799",
              "race": "Culcheth Fillies' Novice Stakes (GBB Race)",
              "race_id": "810114",
              "course": "Haydock",
              "course_id": "crs_598",
              "distance_f": "7",
              "distance_y": "1532",
              "quote": "Inanna is a very nice filly. It was a nice fair track and we decided to send her up there because she had time to organiser herself. She could drop back, she is pretty versatile, but they didn't go much of a gallop. We like her at home and we will see how she comes out of the race. We have a nice bunch of horses, we have kept the numbers down, but hopefully the two-year-olds will be nice - Sean Woods, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Inanna",
              "horse_id": "4281799",
              "quote": "She was very keen when we got her- she was trying to do it all in one breath. But she's done well, winning two of her last four races, ridden by Paul Mulrennan at Carlisle and then at Hamilton by Amie Waugh. She'll probably be kept going for a while as she goes on any ground. She normally runs over 5f or 6f and might stay 7f if she relaxes. She ran over 7f at Musselburgh last month but was a bit too keen and finished second. But she's going the right way and is starting to relax and enjoy her racing. 02-10-24"
            }
          ],
