          "comment": "Good second of eight at Brighton latest but well beaten on his only attempt over 1m",
          "spotlight": "Dual winner over 1m2f; ran well when second of eight at Brighton (1m2f, good to firm; hung left) 24 days ago but he was well beaten on his only attempt over 1m.",
