          "quotes": [],
          "stable_tour": [
            {
              "horse": "Cooperation",
              "horse_id": "3092765",
              "quote": "A new horse to us after we bought him for 6,000gns at the September sales at Newmarket. He's a six-time winner who's had a career-high mark of 84. He's come down to a career-low of 60, having not won in quite a long time. We think he's just the type Mick Appleby can sweeten up and get back on track. He's got a lot of all-weather form and we'll aim him at the bonuses available at the Arena Racing Company tracks. There's a lot of prize-money available for horses like him and we feel he has the right profile and rating to have a good winter on the all-weather. If he can get his mojo back, we could have a lot of fun with him. 26-09-24"
            }
          ],
