          "comment": "Usually in the money here; reportedly bled from the nose when tailed off three weeks ago",
          "spotlight": "Only one win from 18 starts (Flat/hurdles) but that was over C&D (last May) and he twice finished on the heels of the leaders last month, including here; reportedly bled from the nose when tailed off three weeks ago, so needs to bounce back from that.",
