          "stable_tour": [
            {
              "horse": "Fantastic Fox",
              "horse_id": "3261279",
              "quote": "He ran very well to finish ninth in the race last season and the set-up of it suits him. You wouldn't call him progressive but he is capable of running well at a big price.  09-06-25"
            },
            {
              "horse": "Fantastic Fox",
              "horse_id": "3261279",
              "quote": "A most genuine and likeable colt who won for the second time this year when taking a Haydock handicap this month. It was a memorable day for his owners as Leicester City also won the Community Shield at Wembley. It was also a memorable weekend for the yard as we had six winners from as many runners. Although the ground was very testing that day he seems to be effective in any conditions - it was just that he handled the soft conditions better than his rivals. He's a lovely colt going forward and we'll stick to handicaps for the time being, but ultimately I think he'll evolve into a Cup horse. 18-08-21"
            }
          ],
