          "comment": "Returned to form with fair fifth at Epsom three weeks ago but needs to build on that today",
          "spotlight": "Last year's Lincoln winner who returned to form with a fair fifth at Epsom three weeks ago on his preferred slow ground; down to a dangerous mark but has to build on that latest performance to come out on top today.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-03-23",
              "horse": "Mr Professor",
              "horse_id": "3509930",
              "race": "William Hill Lincoln (Heritage Handicap)",
              "race_id": "858318",
              "course": "Doncaster",
              "course_id": "crs_390",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "It was a great performance, Mr Professor travelled supremely well through the race and loved the ground. David was frightened about kicking too soon but when he asked him he quickened nicely and he kept going. If it's soft at Newbury, you'd have to have a look at the Spring Cup. But will it be as testing? Who knows - Dominic Ffrench Davis, trainer."
            },
            {
              "date": "2021-10-18",
              "horse": "Mr Professor",
              "horse_id": "3509930",
              "race": "British Stallion Studs EBF Silver Tankard Stakes (Listed Race)",
              "race_id": "793683",
              "course": "Pontefract",
              "course_id": "crs_1196",
              "distance_f": "8",
              "distance_y": "1766",
              "quote": "Mr Professor has kept on improving this year. The straight track at Newmarket is where he's let us down but he just didn't settle there. He comes out of his races so well, we weigh ours every Monday and he'd put 8kg on since his last run. The ground was an unknown today but he battled to the line, though he wasn't doing an awful lot in front. He's in the sales next week and he is going to go, we'll see what money there is for him - Alice Haynes, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Mr Professor",
              "horse_id": "3509930",
              "quote": "He's been running well. He probably prefers time between his races and we may have made the mistake of running him too quickly at Goodwood the other day. Owen Lewis gets on very well with him at home, felt the ground was a bit soft and he didn't really like it. We'll freshen him up and he'll be out again in about a fortnight. 21-09-23"
            }
          ],
