          "comment": "Progressive last year and reappearance with promising second; weakened over 1m2f last time",
          "spotlight": "Won three in a row last August-October (including on Polytrack; unraced on Tapeta) and reappeared with promising second at Newmarket in April; well beaten at Longchamp since but over 1m2f; one to consider now back at 1m.",
