          "comment": "Impressive on last two encounters with AW and could leave recent turf defeat well behind",
          "spotlight": "Impressive wins on last two encounters with AW, in Southwell maiden (1m, Tapeta) and Kempton handicap (1m, Polytrack); well beaten at Doncaster last time but could bounce back and play a leading role now back on AW.",
