          "quotes": [],
          "stable_tour": [
            {
              "horse": "Superposition",
              "horse_id": "5216540",
              "quote": "He's always shown a considerable amount of talent but sort of lost his way. He had a wind operation and we gelded him last year. I was thrilled with the way he came back, behaving very well at Southwell and winning in impressive fashion considering he carried a four-year-old's weight. He runs at Pontefract on Wednesday. He looks to have got a little bit quicker and I hope he'll continue to progress along the handicap route. He's a very good mover and, touch wood, very sound. I wouldn't want to run him on rattling fast ground, but equally he doesn't want to run on very soft ground either. We're still learning a little bit with him after only five runs but his behaviour last time was fantastic, which is the important thing with him. 30-04-25"
            }
          ],
