          "comment": "Improving filly over 5f and took record to 3-3 with Listed win at Sandown last time",
          "spotlight": "Improving filly over 5f and took record to 3-3 with 25-1 success in Sandown Listed event (good) most recently; incurs 3lb penalty and needs to prove she's as effective at 6f but an unbeaten status earns her respect.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-29",
              "horse": "Anthelia",
              "horse_id": "7020260",
              "race": "Star Sports National Stakes (Listed Race)",
              "race_id": "893980",
              "course": "Sandown",
              "course_id": "crs_1404",
              "distance_f": "5",
              "distance_y": "1110",
              "quote": "We were going to buy one for about 50,000GBP and she was one we picked out, but I thought she wasn't really worth 50,000GBP. We were going to buy something else, but Anthelia was walking round the ring and there were only little bids on her, so I just got her for 6,000GBP - she's worth just a little bit more than that now! We didn't want to get involved in a duel in the front and the main thing today was to get some black type. As it turned out, she's better than I thought she was. She'll still be learning the game and this is the first time she's been roughed up in her race, and it's very exciting for the future. We haven't had one finish at the top of our gallops like her for a long time - Rod Millman, trainer."
            },
            {
              "date": "2025-04-04",
              "horse": "Anthelia",
              "horse_id": "7020260",
              "race": "Happy Birthday Lynn Cullimore British EBF Fillies' Restricted Novice Stakes (Qualifier) (GBB)",
              "race_id": "889308",
              "course": "Bath",
              "course_id": "crs_130",
              "distance_f": "5",
              "distance_y": "1110",
              "quote": "Anthelia had been showing us she was a nice filly from early on in the year and we've been waiting to get a run into her. She's been straightforward and hopefully has a nice future. She's in a couple of sales races, and while it's very early in the season, she can't do any more than she did today in a race that had a few fancied types. We could look at the conditions race at Salisbury [May 4] or the Marygate at York [May 16] next -  Rod Millman, trainer"
            }
          ],
