          "comment": "Justified favouritism at Salisbury last month, posting a career-best performance",
          "spotlight": "Justified favouritism under Billy Loughnane at Salisbury (1m, good to firm) last month, belatedly adding to debut win (7f) and posting a career-best performance; back up 6lb and in grade but can't be ruled out.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-07-21",
              "horse": "Cogitate",
              "horse_id": "5146103",
              "race": "R & M Electrical EBF Novice Stakes (GBB Race) (Div I) (GBB/IRE Incentive Race)",
              "race_id": "844076",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Cogitate is a beautiful looking horse, he has the size and scope and looks to have a big future ahead of him. He qualifies now for the Acomb and that could be a good step. We've won that a couple of times before with Dutch Connection and Phoenix Of Spain so that might be the route he takes."
            }
          ],
          "stable_tour": [
            {
              "horse": "Cogitate",
              "horse_id": "5146103",
              "quote": "He wants fast ground and conditions will be key to his chance. I think a stiff mile will really suit him and he already has some decent form in the book. We were looking to get another run into him before the Britannia, but 93 is a good mark and we've decided to keep our powder dry. He bumped into a good horse in Night Raider on his comeback at Southwell but still ran well and wasn't 100 per cent wound up for that. He's done a couple of nice pieces of work recently and there should be good improvement in him. He's a horse who runs well fresh and I hope he's a Group horse. 13-06-24"
            },
            {
              "horse": "Cogitate",
              "horse_id": "5146103",
              "quote": "He's a lovely, big colt we bought last year. He has a very good attitude and does everything we ask of him at home. He'll be a lovely horse next year but before then he should be okay as a juvenile as everything he has done on the bridle makes me think he's a useful colt. 21-06-23"
            }
          ],
