          "spotlight": "Last nine starts on AW; ended a losing run when scoring at Lingfield (1m) in December but that set up for his closing style and he's not really threatened in four runs since, latterly at Kempton (7f) 113 days ago; can race off his lower turf mark today but others are more persuasive.",
